(51,	'Динис Нефедов',	'https://pp.userapi.com/c846120/v846120604/16cb32/XMN1--PG-0o.jpg?ava=1',	'http://vk.com/id525045111',	'Сайт обманывает народ, и добавляет в черный список чтобы вы не смогли написать жалабу или комментарий я купил аккаунт за 249 р мне пришло но я не могу в него войти пишет что неправильный логин или пароль,так как я думаю что хозяйн аккаунта восстановил ево а мне подсунули непроверенное говно которое не работает, мне не вернули ни деньги ни заменили аккаунт который я купил.',	'08:51:49',	0),
(52,	'Vova Savinov',	'https://pp.userapi.com/c846221/v846221253/ae338/RsmP3s8QJI8.jpg?ava=1',	'http://vk.com/id412807874',	'наебали,купил,а данные не правильные(\n',	'09:59:11',	0),
(53,	'GLAD ValaKAs',	'https://vk.com/images/camera_50.png?ava=1',	'http://vk.com/id529198272',	'Купленные отзывы\nмне пришел пароль пришел логин\nно пишет что пароль или логин не правильный\nЩАС БУДУ писатьв тех поддержку\nнадеюсь ответят',	'17:24:19',	0);
